import React from 'react';
import { ModalWrapper, ModalBox, StyledFaTimes } from './styles';

const Modal = ({ children, open, onClose }) => {
  return (
    <ModalWrapper open={open} onClick={onClose}>
      <ModalBox>
        <div onClick={onClose}>
          <StyledFaTimes onClick={onClose} />
        </div>
        {children}
      </ModalBox>
    </ModalWrapper>
  );
};

export default Modal;
